$(function(){$("#userFeedback>#submitUserFeedback").click(function(){var e=$("#userFeedback>#email").val(),s=$("#userFeedback>#description").val(),a=$("#userFeedback>#isIssue").is(":checked"),c=$("#userFeedback>#isThanks").is(":checked"),i=$("#userFeedback>#rating").val(),n={email:e,description:s,isIssue:a,isThanks:c,rating:i};$.ajax({type:"post",url:"/submitUserFeedback",data:JSON.stringify(n),dataType:"json",contentType:"application/json; charset=utf-8",success:function(e){console.log(e)}})})});